import './App.css';
import React, { useState } from 'react';
import {
  createBrowserRouter,
  RouterProvider,
} from 'react-router-dom';



const App = () => {

   const router = createBrowserRouter([
    {
      path: '/',
      element: <Home/>,
      children: [],
    },
    {
      path: '/Buy_1',
      element: <Buy_1/>,
      children: [],
    },
    {
      path: '/Cart_edit',
      element: <Cart_edit/>,
      children: [],
    },
    {
      path: '/Cart_product',
      element: <Cart_product/>,
      children: [],
    },
    {
      path: '/Cart',
      element: <Cart/>,
      children: [],
    },
    {
      path: '/login',
      element: <Login/>,
      children: [],
    },
    {
      path: '/Catalog',
      element: <Catalog/>,
      children: [],
    },
    {
      path: '/Delivery',
      element: <Cat/>,
      children: [],
    },
  ]);

  return <RouterProvider router={router} />;
};

export default App;
